import { useNavigate } from "react-router-dom";

export default function GridItem({ produto }) {
    const navigate = useNavigate();

    const movimentar = () => {
        navigate(`/MovimentarProduto/${produto.id}`);
    };

    return (
        <div className="card bg-secondary text-light p-3 mb-3 shadow-lg rounded-3 border-0">
            <div className="card-body">
                <h5 className="card-title fw-bold text-warning">{produto.nome}</h5>
                <p className="card-text">
                    <span className="d-block mb-1"><strong>Código EAN:</strong> {produto.id}</span>
                    <span className="d-block mb-1"><strong>Preço:</strong> R$ {produto.preco}</span>
                    <span className="d-block mb-1"><strong>Categoria:</strong> {produto.categoria}</span>
                    <span className="d-block mb-3"><strong>Quantidade:</strong> {produto.quantidade}</span>
                </p>
                <button className="btn btn-outline-warning w-100 fw-bold" onClick={movimentar}>
                    Movimentar Produto
                </button>
            </div>
        </div>
    );
}
